var tipuesearch = {"pages": [{'title': 'stage3-ag2', 'text': '林晏鈴的網站 \xa0 \xa0 \xa0 \xa0 \xa0\xa0 林晏鈴的倉儲 \n 劉怡萱的網站 \xa0 \xa0 \xa0 \xa0 \xa0\xa0 劉怡萱的倉儲 \n 葉沛翎的網站 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 葉沛翎的倉儲 \n 廖苡雯的網站 \xa0 \xa0 \xa0 \xa0 \xa0\xa0 廖苡雯的倉儲 \n 陳冠宇的網站 \xa0 \xa0 \xa0 \xa0 \xa0\xa0 陳冠宇的倉儲 \n 黃翊銘的網站 \xa0 \xa0 \xa0 \xa0 \xa0\xa0 黃翊銘的倉儲 \n 蔡朝旭的網站 \xa0 \xa0 \xa0 \xa0 \xa0\xa0 蔡朝旭的倉儲 \n stage3-ag2 的網站 \n stage3-ag2 的倉儲 \n', 'tags': '', 'url': 'stage3-ag2.html'}, {'title': 'Introduction', 'text': '產品主題  :  機械停車塔\xa0Mechanical parking tower \n 設計理念    : \xa0由於世界人口逐漸增多且寸土寸金，在都市區域租車位都需要碰運氣，有錢也不一定能租到，所以我們就想設計一個可以將大量的車輛容納於一個樓層，不僅可以減少使用地還可以集中管理車輛；因為是自動化的，也能減少人力的消耗 \n \n 設計目標  :\xa0 \n \n \n', 'tags': '', 'url': 'Introduction.html'}, {'title': 'Assignments', 'text': '工作分派 \n 40823101 林晏鈴 網頁更新/繪圖 \n 40823102 劉怡萱 網頁更新/繪圖 \n 40823104 葉沛翎 網頁更新/繪圖 \n 40823106 廖苡雯 網頁更新/程式模擬 \n 40823151 陳冠宇 網頁更新/程式模擬 \n 40871106 黃翊銘 網頁更新/程式模擬 \n 40623121 蔡朝旭 網頁更新/繪圖 \n', 'tags': '', 'url': 'Assignments.html'}, {'title': 'Video', 'text': '', 'tags': '', 'url': 'Video.html'}, {'title': '12', 'text': '抽取組員，進行直播，使用INVENTOR繪製停車場並與組員一起討論想法及呈現樣貌  \n', 'tags': '', 'url': '12.html'}, {'title': '13', 'text': '小組線上討論直播影片  \n', 'tags': '', 'url': '13.html'}, {'title': 'Design', 'text': '', 'tags': '', 'url': 'Design.html'}, {'title': 'D13', 'text': '繪圖組完成停車塔的立體圖繪製，並於直播中與大家共同討論 \n 總共有3種模組 \n \n \n \n 模擬車子 \n \n 電梯轉軸，讓車子可以在這區間做動 \n \n 電梯承載車子的底 \n \n 設計理念為在車子開進去後轉軸帶動電梯門會轉動到車子要進去的方向，上圖( 電梯承載車子的底)會做上下移動，協助車子上下樓，再藉由轉軸帶動電梯門會轉動到車子要停車或離開的方向 \n \n', 'tags': '', 'url': 'D13.html'}, {'title': 'CoppeliaSim', 'text': '', 'tags': '', 'url': 'CoppeliaSim.html'}, {'title': 'Task', 'text': '', 'tags': '', 'url': 'Task.html'}, {'title': 'Experience', 'text': '', 'tags': '', 'url': 'Experience.html'}, {'title': 'w11', 'text': '40823101: \n 40823102: \n 40823104: \n 40823106: \n 40823151:這次專題增加了許多組員，大家都都有點手忙腳亂的，一時之間沒辦法發揮團隊合作的力量，但經過討論及溝通後，大家開始互相合作，分工明確，開始發揮團隊合作的功用，在一開始不清楚這麼多人大家分工要怎麼分，但定好目標後，大家都各司其職，盡忠職守，讓團隊發揮最大效益。 \n 40871106: \n 40623121: \n', 'tags': '', 'url': 'w11.html'}, {'title': 'w12', 'text': '40823101: \n 40823102: \n 40823104: \n 40823106: \n 40823151:我們開始討論，機械停車塔的細部構造，繪圖與打程式的人互相討論討論出一個最佳解，同一時間有人一邊研究老師給我們的題目，並仔細聽老師的指導內容，生怕遺漏一絲一毫，而跟不上大家的腳步。 \n 40871106: \n 40623121: \n', 'tags': '', 'url': 'w12.html'}, {'title': 'w13', 'text': '40823101: \n 40823102:已先將立體圖繪製完成，並在視訊課程跟同學討論 \n 40823104:利用視訊課程將自己畫好的圖與同學討論 \n 40823106:同學利用遠端視訊的方式分享自己所繪製的圖，並分配各自負責的工作 \n 40823151:這周開始有人畫好圖後開始打程式，程式的部分必須真的花很多心力，與組員討論並且得到一個最佳解 \n 40871106: \n 40623121: \n', 'tags': '', 'url': 'w13.html'}, {'title': 'w14', 'text': '40823101: \n 40823102: \n 40823104: \n 40823106: \n 40823151: \n 40871106: \n 40623121: \n', 'tags': '', 'url': 'w14.html'}, {'title': 'Final Report', 'text': '', 'tags': '', 'url': 'Final Report.html'}]};